import React from "react";
import Types from './beer/types'
import Country from './beer/country'
import Table from './beer/table'

const Beer = () => {

  return (
    <div className="container">
        <div className="row">
          <div className="col-12 text-center border">
            <h1>Beer</h1>
            <p>coming soon</p>
          </div>
          <div className="col-12">
            <Table />
            <Types />
            <Country />
          </div>
        </div>
    </div>
  )
}

function mapStateToProps(state){
  const gear = state.kitsReducer;
  return {
    gear: gear
  }
}

export default (Beer);
